import React from 'react';
import {Routes, Route, useNavigate, useParams, useLocation,useSearchParams} from "react-router-dom";

import './UserPage.css';
import placeholder from '../../images/placeholderimage.png';
import axios from "axios";

export function UserPage() {
    const navigate = useNavigate();
    const location = useLocation();
const [searchParams] = useSearchParams()
const params = new URLSearchParams(location.search)

const userName = async ()=>{
    let id = params.get('id')

    await axios.get(`http://localhost:4011/:${id}`).then(response => console.log(response))
}
 console.log(userName())
    const createPost = ()=>{
        //navigate to /new post page
        navigate('/login/userpage/newpost');
    }



    return(
        <div>
            <div className='location'>
                <h2 className='location-title'>My Locations</h2>
            </div>
            <div className="location-list">

                <div className="location-card">
                    <h5>Location 1</h5>
                </div>
                <div className="location-card">
                    <h5>Location 2</h5>
                </div>
                <div className="location-card">
                    <h5>Location 3</h5>
                </div>
                <div className="location-card">
                    <h5>Location 4</h5>
                </div>
                <div className="location-card">
                    <h5>Location 5</h5>
                </div>
            </div>
            <div className="new-experience">
                <h2 className="new-experience-title" >Enter a new experience</h2>
                <button className="button_create" onClick={createPost}> New Post</button>
            </div>
        </div>

    )
}
